import React from "react";
import {
  InfoWrapper,
  InfoContainer,
  InfoRow,
  Column1,
  Column2,
  TextWrapper,
  TopLine,
  Heading,
  Sub,
  BtnWrap,
  Img,
  ImgWrap,
} from "./infoElements";
import { Button } from "../ButtonElemnt";

const InfoSection = ({
  id,
  imgstart,
  topLine,
  lightText,
  darkText,
  headline,
  description,
  alt,
  img,
  lightBg,
  displayed,
  buttonLable,
  primary,
  dark,
  //dark2,
}) => {
  return (
    <>
      <InfoContainer lightBg={lightBg} id={id}>
        <InfoWrapper>
          <InfoRow imgstart={imgstart}>
            <Column1>
              <TextWrapper>
                <TopLine displayed={displayed}>{topLine}</TopLine>
                <Heading lightText={lightText}>{headline}</Heading>
                <Sub darkText={darkText}>{description}</Sub>
                <BtnWrap>
                  <Button
                    to="home"
                    primary={primary ? 1 : 0}
                    smooth={true}
                    duration={500}
                    spy={true}
                    exact={true}
                    offset={-80}
                    dark={dark ? 1 : 0}
                  >
                    {buttonLable}
                  </Button>
                </BtnWrap>
              </TextWrapper>
            </Column1>
            <Column2>
              <ImgWrap>
                <Img src={img} alt={alt} />
              </ImgWrap>
            </Column2>
          </InfoRow>
        </InfoWrapper>
      </InfoContainer>
    </>
  );
};

export default InfoSection;
